message:
Важное из обращения Зеленского:

– Президент Украины считает себя главной целью российских войск;

– «Вторжение России на Украину – это не просто вторжение, это начало войны против Европы» – Зеленский;

– Зеленский предложил Путину сесть за стол переговоров.

– Зеленский осудил Запад за долгие действия и призвал отключить Россию от SWIFT, отозвать послов, внести нефтяное эмбарго и аннулировать визы россиянам в Европу.
